//arrays of difference between image arrays
let b9to18 = [];
let b20to15 = [];

//updating array for image vector of branch
let bTemp = [];

//initiate incrementing variable to calculate difference between branches at 0
let difference = 0;

//poseNet model variables:
let webcam;
let poseNet;
let pose;
let skeleton;
let brain;
let state = 'waiting';
let poseLabel;

//branches output
let outputImage;
const imgSize = 1064; //image vector array takes 512 elements but the spcified size on runwayML for this styleGAN2 model is 1064

function setup() {
    //create webcam feed (hide) and canvas
    webcam = createCapture(VIDEO);
    createCanvas(1280, 580);
    webcam.hide();
    
    //setup poseNet
    poseNet = ml5.poseNet(webcam, modelLoaded);
    poseNet.on('pose', gotPoses);

    //trained classification on 2 poses:
    let options = {
        inputs: 34,
        outputs: 2,
        task: 'classification',
        debug: true
    }
    brain = ml5.neuralNetwork(options);
    //load pretrained model
    const modelInfo = {
        model: 'model/model.json',
        metadata: 'model/model_meta.json',
        weights: 'model/model.weights.bin',
    };
    brain.load(modelInfo, brainLoaded);

    generateImage();
}

function delay(time) {
    return new Promise((resolve, reject) => {
        if (isNaN(time)) {
            reject(new Error('delay requires a valid number'));
        } else {
            setTimeout(resolve, time);
        }
    });
}

function brainLoaded() {
    console.log('pose classification ready!');
    classifyPose();
}

function classifyPose() { // classify the poses
    if (pose) {
        let inputs = [];
        for (let i = 0; i < pose.keypoints.length; i++) {
            let x = pose.keypoints[i].position.x;
            let y = pose.keypoints[i].position.y;
            inputs.push(x);
            inputs.push(y);
        }
        brain.classify(inputs, gotResult);
    } else {
        setTimeout(classifyPose, 100);
    }
}

function gotResult(error, results) {
    if (results[0].confidence > 0.75) {
        poseLabel = results[0].label.toUpperCase();
    }
    classifyPose();
}

function dataReady() { //train
    brain.normalizeData();
    brain.train({
        epochs: 50
    }, finished);
}

function finished() { // model has finished training
    console.log('model trained');
    brain.save();
    classifyPose();
}

function gotPoses(poses) { // collect poses
    if (poses.length > 0) {
        pose = poses[0].pose;
        skeleton = poses[0].skeleton;
        if (state == 'collecting') {
            let inputs = [];
            for (let i = 0; i < pose.keypoints.length; i++) {
                let x = pose.keypoints[i].position.x;
                let y = pose.keypoints[i].position.y;
                inputs.push(x);
                inputs.push(y);
            }
            let target = [targetLabel];
            brain.addData(inputs, target);
        }
    }
}

function modelLoaded() {
    console.log('poseNet ready');
}

