//code to generate branch transitions:

async function generateImage() {
    //fetch hosted model
    const model = new rw.HostedModel({
        url: "https://branches.hosted-models.runwayml.cloud/v1/",
    });

    //increase difference variable between 0 and 5 so the animation loops
    difference = (difference + 0.1) % 5;

    //generate branch animations in pairs
    for (var i = 0; i < b20.length; i++) {
        b9to18[i] = b9[i] - b18[i];
        b20to15[i] = b20[i] - b15[i];
        //using midpoint logic to calculate distance between frames and animate
        if (poseLabel == 'Y') {
            bTemp[i] = b9to18[i] / difference + b18[i] + b19[i];
        } else if (poseLabel == 'V') {
            bTemp[i] = b20to15[i] / difference + b16[i] + b15[i];
        } else {
            bTemp[i] = b9[i];
        }
    }
    
    const data = {
        z: bTemp, //generated latent space vector
        truncation: 0.5, //variation in image generations
    };

    //if model is loaded use data, obtain result
    if (typeof (model) != 'undefined') {
        const result = await model.query(data)
        gotImage(result)
    }
}

function gotError(error) { //if the generate image post request fails
    console.error(error);
}

function gotImage(result) { //called once generate image has received a response
    outputImage = createImg(result.image, imageReady);
    outputImage.hide();
}

function imageReady() {
    //draw output image and call generateImage()
    image(outputImage, 0, 0, 600, 600);
    generateImage();
}

function draw() {
    push();
    //flip and move webcam feed to side, draw
    translate(webcam.width + 670, 0);
    scale(-1, 1);
    image(webcam, 0, 0, webcam.width, webcam.height);
    pop();

    //write poseLabel top left
    if (poseLabel) {
        fill(255, 0, 0);
        textSize(40);
        text(poseLabel, 30, 60);
    }
}